                BeginContext(1831, 5153, true);
                WriteLiteral(@"<em>Руководитель стажировки - <strong>Мельниченко Елена Дмитриевна</strong> – директор оценочной компании, председатель Днепропетровского областного отделения Ассоциации специалистов оценки, председатель Днепропетровского областного отделения Союза оценщиков земли (СОЗ), </em><em>эксперт-оценщик высшей категории сертифицированный <a href=""http://afo.com.ua/ru/myprofile/userprofile/187"" target=""_blank"">«Ассоциацией специалистов оценки»</a> (АФО)<span style=""font-style: italic;"">. Стаж работы в оценочной деятельности - с 1996 года.</span></em></p>
                <p class=""abzac"">Курс стажировки проходит в формате теоретических и практических занятий. Занятия проводятся оценщиками, имеющими многолетний опыт практической деятельности, а также при формировании группы - аудиторами, сметчиками, специалистами БТИ, риелторами.</p>
                <p class=""abzac"">Приглашаем будущих оценщиков из всех регионов Украины.</p>
                <p class=""abzac"">Формат проведения – онлайн или по согласованию руководителя с");
                WriteLiteral(@"тажировки и стажера.</p>
                <p class=""abzac"">Программа рассчитана на стажеров, обучившихся в учебных центрах, а также всех заинтересованных слушателей, молодых оценщиков для приобретения качественного практического опыта в оценке.</p>
                <p class=""abzac"">Полнота раскрытия вопросов соответствует программе учебных центров, лицензированных Фондом государственного имущества Украины.</p>
                <p class=""abzac"">Стажеру предоставляется возможность в текущем режиме времени консультироваться с руководителем стажировки.</p>
                <p class=""abzac"">Для слушателей, не имеющих базового образования оценщика, часы стажировки засчитываются в общий стаж стажировки.</p>
                <p class=""podzagolovok1"" style=""margin-left:25px;"">Стажировка включает:</p>
                <ol>
                    <li> Теоретические семинары, углубленное изучение методических подходов. Проведение семинаров-тренингов.</li>
                    <li> Проведение выездных практических занятий п");
